import Nav from './Nav'
import React from 'react'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import './App.css';

const App = () => {

  return (
    <Router>
      <div className="home">
        <Nav />
        <Switch>
          <Route path="/" component/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
